'use client';

import * as Types from '@/lib/types';
import * as Ui from '@/ui';

import Link from 'next/link';

type AliceSocialMediaProps = {
  socialMediaLinks: Types.SocialMediaLink[];
};

const AliceSocialMedia: React.FC<AliceSocialMediaProps> = ({ socialMediaLinks }) => {
  const platforms = ['instagram', 'discord', 'tiktok', 'youtube'];
  const socialMediaLinksFiltered = socialMediaLinks.filter((item) =>
    platforms.includes(item.platform),
  );
  return (
    <div className="p-12 bg-[#8c8971] text-overlay flex flex-col gap-y-6 items-center">
      <Ui.Text.Lead as="h2">Follow me</Ui.Text.Lead>
      <div className="grid grid-cols-2">
        {socialMediaLinksFiltered.map((link) => {
          const Icon = Icons[link.platform];
          return (
            <Link
              key={link._key}
              href={link.url}
              target="_blank"
              className="px-8 py-5 flex flex-col items-center gap-y-3"
            >
              <div className="w-28 h-28">
                <Icon />
              </div>
              <Ui.Text.Label className="capitalize">{link.platform}</Ui.Text.Label>
            </Link>
          );
        })}
      </div>
    </div>
  );
};

export default AliceSocialMedia;

